            {YouTubeVideos?.map((singleVideo) => {
                let vidId = singleVideo.id.videoId;
                let vidLink =`https://www.youtube.com/watch?v=${vidId}`;
            
                let videoWrapper =(
                    <div key={vidId} className='col-sm-12 col-md-6'>
